import React from 'react';
import './Card.css';
import  "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import view from '../../Images/viewimg.png';
import share from '../../Images/share.png';
export default function Card(props){

    return(
        <>
        <div class="card" >
             <img src={props.img} class="card-img-top" alt="..."/>
             <div class="card-body">
                 <p className='prof'>{props.prof}</p>
               <h5 class="card-title">{props.title}</h5>
               <p class="card-text">{props.about}</p>
               <div className="info">
                   <div className="left">
                     <img src={props.dp} alt="" />
                     <span style={{marginLeft:"10px",fontWeight:"bolder"}}>{props.name}</span>
                   </div>
                   <div className="right">
                       <img  src={view} alt="" className='view'/>
                       <span>1.4k views</span>
                       <span ><img src={share} alt="" /></span>
                       
                   </div>
               </div>
             </div>
        </div>
        </>
    )
}
